import React from "react";
import './index.css'

function App() {


    let time = new Date().getHours();
    let Greet = " ";
    let Css ={};

    if (time >= 1 && time < 11) {
        Greet = "Good Morning";
        Css.color = "Orange";
    }
    else if (time > 12 && time < 19) {
        Greet = "Good Afternoon";
        Css.color = "Red";
    }
    else {
        Greet = "Good Night";
        Css.color = "Black";
    }

    return (
        <div className='DivStyle'>
            <h1 className='H1'>Hello Sir <span style={Css}>{Greet}</span></h1>
        </div>
    )

}

export default App;
